/*Table structure for table `discipline` */

DROP TABLE IF EXISTS `discipline`;

CREATE TABLE `discipline` (
  `Dno` char(5) NOT NULL COMMENT '专业编号',
  `Fno` char(5) DEFAULT NULL COMMENT '学院编号',
  `Dname` varchar(30) DEFAULT NULL COMMENT '专业名',
  `Dteacher` varchar(10) DEFAULT NULL COMMENT '专业导师',
  PRIMARY KEY (`Dno`),
  KEY `Fno` (`Fno`),
  CONSTRAINT `discipline_ibfk_1` FOREIGN KEY (`Fno`) REFERENCES `faculty` (`Fno`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

