/*Table structure for table `faculty` */

DROP TABLE IF EXISTS `faculty`;

CREATE TABLE `faculty` (
  `Fno` char(5) NOT NULL COMMENT '学院编号',
  `Fname` varchar(20) DEFAULT NULL COMMENT '学院名',
  `Fteacher` varchar(10) DEFAULT NULL COMMENT '学院一把手',
