/*Table structure for table `sc` */

DROP TABLE IF EXISTS `sc`;

CREATE TABLE `sc` (
  `Sno` char(5) NOT NULL COMMENT '学号',
  `Cno` char(5) NOT NULL COMMENT '课程号',
  `Score` smallint(6) DEFAULT NULL COMMENT '成绩',
  PRIMARY KEY (`Sno`,`Cno`),
  KEY `sc_ibfk_2` (`Cno`),
  CONSTRAINT `sc_ibfk_1` FOREIGN KEY (`Sno`) REFERENCES `student` (`Sno`),
  CONSTRAINT `sc_ibfk_2` FOREIGN KEY (`Cno`) REFERENCES `course` (`Cno`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sc` */

/*Table structure for table `student` */

DROP TABLE IF EXISTS `student`;

CREATE TABLE `student` (
  `Sno` char(5) NOT NULL COMMENT '学号',
  `Sname` varchar(10) NOT NULL COMMENT '姓名',
  `Ssex` varchar(2) NOT NULL COMMENT '性别',
  `Sage` smallint(6) NOT NULL COMMENT '年龄',
  `Dno` char(5) NOT NULL COMMENT '学生所属专业的专业号',
  `Sgrade` varchar(6) NOT NULL COMMENT '年级',
  `Sphone` char(11) DEFAULT NULL COMMENT '电话号码',
  `Spassword` char(16) NOT NULL DEFAULT '123456' COMMENT '密码',
  `Sphoto` char(100) DEFAULT NULL COMMENT '头像',
  PRIMARY KEY (`Sno`),
  KEY `Dno` (`Dno`),
  CONSTRAINT `student_ibfk_1` FOREIGN KEY (`Dno`) REFERENCES `discipline` (`Dno`)
